import { Link, useNavigate } from 'react-router-dom';
import '../styles/Navbar.css';

export default function Navbar() {
  const navigate = useNavigate();
  const isLoggedIn = !!localStorage.getItem('token');

  const handleLogout = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user'); // optional if you store user info
    navigate('/login');
  };

  return (
    <nav className="navbar">
      <div className="navbar-left">
        <Link
          to="/"
          className="logo-link"
          style={{ textDecoration: 'none', color: 'inherit', display: 'flex', alignItems: 'center' }}
        >
          <img src="/images/medicalicon.jpeg" alt="MediReach Icon" className="medireach-icon" />
          <div className="logo-text">
            <h2>MediReach</h2>
            <p className="motto">Your Health, Our Reach</p>
          </div>
        </Link>

        <div className="nav-links">
          <Link to="/dashboard" className="nav-link">Dashboard</Link>
          <Link to="/appointments" className="nav-link">Appointments</Link>
          <Link to="/book-appointment" className="nav-link">Book Appointment</Link>
        </div>
      </div>

      <div className="navbar-right">
        {!isLoggedIn ? (
          <>
            <Link to="/register">
              <button className="nav-button">Register</button>
            </Link>
            <Link to="/login">
              <button className="nav-button">Login</button>
            </Link>
          </>
        ) : (
          <button onClick={handleLogout} className="nav-button logout-button">
            Logout
          </button>
        )}
      </div>
    </nav>
  );
}
